import styled from "styled-components"
const CollectionItem = styled.div`
    display:flex;
    text-align: center;
    cursor: default;
    background: #42b078;
    .caption{
        width: 100%;
        height: 100%;
        position: absolute;
        overflow: hidden;
        top: 0;
        left: 0;
        padding: 50px 20px;
    }
`
export default CollectionItem
